import React, { useState, useEffect } from 'react';

interface ITreeViewProps {
    name: string,
    data: []
}
const TreeView = ({ name, data }: ITreeViewProps): JSX.Element => {

    const [isToggle, setIsToggled] = useState<boolean>(false);

    const toggleReport = () => {
        setIsToggled(!isToggle)
    }

    return (
        <>
            <div className="App">
                <ul className="tree">
                    <li className="tree_li">
                        <input type="checkbox" checked id="c1" />
                        <label className="tree_label label_dropdwn" htmlFor="c1"><span>Level 0</span></label>
                    </li>
                </ul>
            </div>
            {/* {isToggle && } */}
        </>
    )
}

export default TreeView;
